.sprite, \"shock\"),\n            Wait(0.8),\n            Animate(self.scene.objectLookup.FleetBicker.sprite, \"lookright\"),\n            Animate(self.scene.objectLookup.SonicBicker.sprite, \"worried\"),\n            MessageBox {message = \"Sonic: Hey, don't get too pumped, bird brain. {p40}I was goin' easy on ya. {p40}You're our guests after all.\"},\n            Animate(self.scene.objectLookup.FleetBicker.sprite, \"smirk\"),\n            MessageBox {message = \"Fleet: Hehe, {p40}keep telling yourself that.\"},\n            Do(function() self.scene.objectLookup.FleetBicker.sprite:setAnimation(\"laugh\") end),\n            Animate(self.scene.objectLookup.SonicBicker.sprite, \"irritated\"),\n            Do(function() self:refreshKeyHint() end)\n        }\n    end\nend",
