sform.sy = 4\n                            self.scene.arrow.sprite.transform.angle = 0\n                            self.scene.arrow.sprite.color[4] = 0\n                            self.scene.arrow.sprite:setAnimation(\"point\")\n                            self.scene:addObject(self.scene.arrow)\n                            self.scene.arrow:run(Ease(self.scene.arrow.sprite.color, 4, 255, 1))\n                            self.scene.player.hits = 10\n                            self.scene.player.puckhit = function(_, key)\n                                if key == \"x\" and not self.scene.arrow.hidden then\n                                    self.scene.arrow.hidden = true\n                                    self.scene.player.hits = self.scene.player.hits - 1\n                                    local gameoverAction = Serial {\n                                        Do(function()\n                                            self.scene.arrow.hidden = false\n                                            self.scene.arrow.sprite.color[4] = 0\n                                        end),\n                                        Ease(self.scene.arrow.sprite.color, 4, 255, 1)\n                                    }\n                                    if self.scene.player.hits <= 0 then\n                                        gameoverAction = Serial {\n                                            Do(function()\n                                                self.scene.player.basicUpdate = self.scene.player.updateFun\n                                                self.scene.player:removeSceneHandler(\"keytriggered\", self.scene.player.puckhit)\n                                                self.scene.arrow:remove()\n                                                GameState:setFlag(\"ep3_hockey\")\n                                            end),\n                                            PlayAudio(\"music\", \"sallyrally\", 1.0),\n                                     